import React from 'react';



const Contacts = () => {
    return (
        <div className="contacts-page">
            <h1>Контакты</h1>
            <p>Вы можете связаться с нами любым удобным для вас способом:</p>
            <ul>
                <li>Телефон: +7 (123) 456-78-90</li>
                <li>Email: info@company.com</li>
                <li>Адрес: ул. Примерная, д. 123, г. Москва</li>
            </ul>
            <div className="map-container">
                <iframe
                    src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3151.8354345098585!2d144.9537363156177!3d-37.81720997975179!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x6ad642af0f11fd81%3A0xf0727b3e1467a949!2sEureka%20Tower!5e0!3m2!1sen!2sau!4v1613952709775!5m2!1sen!2sau"
                    width="100%"
                    height="400"
                    style={{ border: 0 }}
                    allowFullScreen=""
                    loading="lazy"
                    title="Google Maps"
                ></iframe>
            </div>
        </div>
    );
};



const styles = {
    container: {
        padding: '40px 20px',
        backgroundColor: '#f4f4f4',
        textAlign: 'center',
    },
    title: {
        fontSize: '32px',
        fontWeight: 'bold',
        marginBottom: '20px',
    },
    text: {
        fontSize: '18px',
        color: '#333',
        marginBottom: '10px',
    },
    contactInfo: {
        display: 'flex',
        justifyContent: 'center',
        gap: '30px',
        flexWrap: 'wrap',
    },
    contactItem: {
        flex: '1 1 200px',
    },
    label: {
        fontWeight: 'bold',
        fontSize: '16px',
    },
};

export default Contact;
